from collections import Counter
class Solution:
    def checkInclusion(self, s1: str, s2: str) -> bool:
        '''
            s1 = 'aabbc'
            s2 = 'xyzbcabpqrbcaabmno'
        '''
        N, M = len(s1), len(s2)
        cntr1 = Counter(s1)
        for i in range(M):
            if s2[i] in cntr1:
                if Counter(s2[i:i+N]) == cntr1:
                    print(f'\tAbout to return True at i = {i}, ch = {s2[i]}')
                    return True
        return False
